cordova.define("com.jiedaibao.closewindow.CloseWindow", function (require, exports, module) {
   var exec = require('cordova/exec');
   module.exports = {
       closeWindow : function(successCallback, errorCallback) {
       exec(
            successCallback,
            errorCallback,
            'CloseWindow',
            'closeWindow',
            []
            );
       }
    }
  }
);
